var Base = require("base42");
var SetMfn = require("./SetMfn");
var ExtendMfn = require("./ExtendMfn");
var logger = require("log42");

var Set = require("set42");
var Extend = require("extend42");

var set = SetMfn.make();
var extend = ExtendMfn.make();

// if (true){
// 	set = Set().fn;
// 	extend = Extend().fn;
// }

var Mod1 = Base.extend({
	name: "Mod1",
	set: set,
	instantiate: function(){
		this.inst && this.inst();
		this.set.apply(this, arguments);
		this.initialize.apply(this, arguments);
		return this;
	},
	initialize: function(){
		this.init();
	},
	init: function(){}
}).assign({
	extend: extend,
	set: set
});

logger.install(Mod1);
logger.install(Mod1.prototype);

module.exports = Mod1;